import './index.css';
import './App.css';
import React, { Component } from "react";
import Button from 'react-bootstrap/Button';
import ToggleButton from "@material-ui/buttons/toggle";


export default class DisplayList extends Component {
    render() {
        return (
            <div class="all">
                <div>
                    {this.props.list.map(piece =>
                        <div class="image_div">
                            <img src={piece.src} alt="blah" class="image" />
                            <div class="image_desc">
                                <div>
                                    <div class="title_and_medium">
                                        <h1 class="name">{piece.name}</h1>
                                        <h1 class="medium">  - {piece.medium}</h1>
                                    </div>
                                    <h4 class="date">{piece.date}</h4>
                                </div>
                                <h3>{piece.award}</h3>
                                <div class="time">
                                    <h4>Total Time: {piece.time} hours</h4>
                                    <Button variant="dark" onClick={() => this.props.addTime(piece.time)}>Add to Time Counter</Button>
                                </div>
                            </div>
                        </div>)

                    }
                </div>
            </div>
        )
    }

}
